import React from 'react';

import styles from './NavSections.module.css';

const navSections = () => {
    return (
        <ul id={styles.navSections}> 
            <li>About</li>
            <li>Projects</li>
            <li>Career</li>
            <li>Contact</li>
        </ul>
    )
} 

export default navSections;
